import TaskList from "./TaskList";

const AllTasks = (props) => {
    return(
        <div>
            {props.items.map((tasks => <TaskList key={tasks.id} title={tasks.task} deleteTask={props.delete} />))}
        </div>
    );
}

export default AllTasks;
